import React from 'react';
import './InfoWindow.css'; 
import appLogo from './images/logo.svg'; 

const InfoWindow = () => {
  return (
    <div className="info-window">
      <div className="info-content">
        <img src={appLogo} alt="App Logo" className="info-logo" />
        <h3>Welcome to Our App</h3>
        <p>
          Here's how you can use the app:
          <ul>
            <li>Upload your CSV or SVG file using the file input menu on the left.</li>
            <li>Enter any custom input into the form for personalized actions.</li>
            <li>View the results displayed directly below each menu.</li>
            <li>You can drag these menus around for convenience.</li>
          </ul>
        </p>
      </div>
    </div>
  );
};

export default InfoWindow;
